import React, { Component } from 'react'

 class Todoapplist extends Component {
  render() {
    return (
      <div>
        <ul class="ul">
          {this.props.items.map((item,index)=> {
            return <li class="list"  > 
            <input id="myCheckBox" type="checkbox" class="checkbox"></input>
               <span>{item} </span><button  class="deletebtn" key ={index} onClick={this.props.deleteTask.bind(this,index)} ><i  class="fa fa-trash" ></i></button> 
           </li>
          }

          )}
        </ul>
      </div>
    )
  }
}

export default Todoapplist


